import './App.css';

function App() {
  return (
    <div>
       <h1>Welcome to Easy Tracking!</h1>
       <p>Login Page</p>
       <Auth />

    </div>
  );
}

function Auth() {
  return (
    <div>
      <input type="email" placeholder='Please enter your Email' />

      <input type="password" placeholder='Please enter your password' />
    </div>
  )
}

export default App;
